uint32_t kick_counter = 0;
uint32_t CH_counter = 0;
uint32_t snare_counter = 0;
bool playing = 0;
void drum_play(int32_t &Vout, uint8_t &activeNotes, int index)
{

    int8_t drum_index = index / 4;
    switch (drum_index)
    {
    case 0:
        playing = 1;
        Vout = CH[CH_counter];
        if (playing)
        {
            CH_counter++;
        }
        if (CH_counter > 8000)
        {
            CH_counter = 0;
        }

        break;
    case 1:
        playing = 1;
        Vout = kick[kick_counter];
        if (playing)
        {
            kick_counter++;
        }
        if (kick_counter > 8000)
        {
            kick_counter = 0;
        }
        break;

    case 2:
        playing = 1;
        Vout = snare[snare_counter];
        if (playing)
        {
            snare_counter++;
        }
        if (snare_counter > 11000)
        {
            snare_counter = 0;
        }
        break;

    default:
        if (!playing)
        {
            kick_counter = 0;
            CH_counter = 0;
            snare_counter = 0;
        }
    }

    Vout = Vout - 128;
}

